posts/interfaces.html.body:
接口

英文文档：http://www.typescriptlang.org/docs/handbook/interfaces.html
中文文档：https://www.tslang.cn/docs/handbook/interfaces.html

接口基本示例
interface User {
  name: string
  nickName?: string // 可选属性
  readonly age: number // 只读属性
  [propName: string]: any // 任意数量的属性
}

// 接口继承
interface Student extends User {
  number: number
}

function printUser(stu: Student): void {
  console.log(stu)
}

printUser({
  name: "alfredolee",
  age: 25,
  number: 1,
})

函数类型
SearchFunc定义了函数的签名类型和返回值类型，mySearch实现了这个接口。
interface SearchFunc {
  (source: string, subString: string): boolean
}

let mySearch: SearchFunc = function(source: string, subString: string) {
  let result = source.search(subString)
  return result > -1
}


函数的参数名不需要与接口里定义的名字相匹配。

可索引的类型
示例：
interface StringArray {
  [index: number]: string
}

let myArray: StringArray
myArray = ["Bob", "Fred"]

let myStr: string = myArray[0]

TypeScript 支持两种索引签名：字符串和数字。 可以同时使用两种类型的索引，但是数字索引的返回值必须是字符串索引返回值类型的子类型。 这是因为当使用 number 来索引时，JavaScript 会将它转换成 string 然后再去索引对象。 也就是说用 100（一个 number）去索引等同于使用"100"（一个 string）去索引，因此两者需要保持一致。
class Animal {
  name: string
}
class Dog extends Animal {
  breed: string
}

// 错误：使用数值型的字符串索引，有时会得到完全不同的Animal!
interface NotOkay {
  [x: number]: Animal
  [x: string]: Dog
}

类类型
与 C#或 Java 里接口的基本作用一样，TypeScript 也能够用它来明确的强制一个类去符合某种契约。
interface ClockInterface {
  currentTime: Date
  setTime(d: Date)
}

class Clock implements ClockInterface {
  currentTime: Date
  setTime(d: Date) {
    this.currentTime = d
  }
  constructor(h: number, m: number) {}
}


接口描述了类的公共部分，而不是公共和私有两部分。 它不会帮你检查类是否具有某些私有成员。

混合类型
一个对象可以同时做为函数和对象使用，并带有额外的属性。
interface Counter {
  (start: number): string
  interval: number
  reset(): void
}

function getCounter(): Counter {
  let counter = function(start: number) {}
  counter.interval = 123
  counter.reset = function() {}
  return counter
}

let c = getCounter()
c(10)
c.reset()
c.interval = 5.0

接口继承类
接口继承类,接口继承类的所有成员(包括私有成员和受保护成员),但不会实现。如果继承的类中含有私有成员或受保护成员，这个接口类型只能被这个类或其子类所实现。
class Control {
  private state: any
}

interface SelectableControl extends Control {
  select(): void
}

class Button extends Control implements SelectableControl {
  select() {}
}

// 错误：“Image”类型缺少“state”属性。
class Image implements SelectableControl {
  select() {}
}

posts/classes.html.body:
类

英文文档：http://www.typescriptlang.org/docs/handbook/classes.html
中文文档：https://www.tslang.cn/docs/handbook/classes.html

示例代码
class Person {
  static total = 0 // 每个实例想要访问这个属性的时候，都要通过 Person.total 访问。
  protected name: string // protected成员只能在声明它的类和派生类中访问。
  private age: number // 不能在声明它的类的外部访问。
  readonly id: number // 只读属性必须在声明时或构造函数里被初始化。

  // 构造函数也可以被标记成 protected。 这意味着这个类不能在包含它的类外被实例化，但是能被继承。
  protected constructor(name: string, age: number, id: number) {
    this.name = name
    this.age = age
    this.id = id
  }
}

class Employee extends Person {
  private department: string

  constructor(name: string, age: number, id: number, department: string) {
    super(name, age, id)
    this.department = department
  }

  public printEmployee() {
    return `Hello, my name is ${this.name} and I work in ${this.department}.`
  }
}

参数属性
参数属性通过给构造函数参数前面添加一个访问限定符来声明。使用 private 限定一个参数属性会声明并初始化一个私有成员；对于 public 和 protected 来说也是一样。
class Person {
  readonly id: number

  constructor(id: number) {
    this.id = id
  }
}

通过参数属性可以写为:
class Person {
  constructor(readonly id: number) {}
}

存取器(getters/setters)
通过 getters/setters 来截取对对象成员的访问, 它能帮助你有效的控制对对象成员的访问。
let passcode = "secret passcode"

class Employee {
  private _fullName: string

  get fullName(): string {
    return this._fullName
  }

  set fullName(newName: string) {
    if (passcode && passcode == "secret passcode") {
      this._fullName = newName
    } else {
      console.log("Error: Unauthorized update of employee!")
    }
  }
}


只带有 get 不带有 set 的存取器自动被推断为 readonly。

抽象类
抽象类做为其它派生类的基类使用。 它们一般不会直接被实例化。 不同于接口，抽象类可以包含成员的实现细节。 abstract 关键字是用于定义抽象类和在抽象类内部定义抽象方法。
abstract class Department {
  constructor(public name: string) {}

  printName(): void {
    console.log("Department name: " + this.name)
  }

  abstract printMeeting(): void // 抽象方法, 必须在派生类中实现
}

class AccountingDepartment extends Department {
  constructor() {
    super("Accounting and Auditing") // 在派生类的构造函数中必须调用 super()
  }

  printMeeting(): void {
    console.log("The Accounting Department meets each Monday at 10am.")
  }

  generateReports(): void {
    console.log("Generating accounting reports...")
  }
}

let department: Department // 允许创建一个对抽象类型的引用
// department = new Department(); // 错误: 不能创建一个抽象类的实例
department = new AccountingDepartment() // 允许对一个抽象子类进行实例化和赋值
department.printName()
department.printMeeting()
// department.generateReports(); // 错误: 方法在声明的抽象类中不存在

posts/functions.html.body:
函数

英文文档：http://www.typescriptlang.org/docs/handbook/functions.html
中文文档：https://www.tslang.cn/docs/handbook/functions.html

let myAdd = (x, y) => {
  return x + y
}

写成完整函数类型就称下面的样子, 当然你仍旧可以省略其中的一部分，ts 会自己推断类型：
let myAdd: (baseValue: number, increment: number) => number = (x: number, y: number): number => {
  return x + y
}

可选参数
function buildName(firstName: string, lastName?: string) {
  // ...
}

默认参数
function buildName(firstName = "alfredo", lastName: string) {
  // ...
}

剩余参数
function buildName(firstName: string, ...restOfName: string[]) {
  return firstName + " " + restOfName.join(" ")
}

重载
因为前两句话的重载，pickCard在调用的时候就会进行类型检查。
function pickCard(x: { suit: string; card: number }[]): number
function pickCard(x: number): { suit: string; card: number }
function pickCard(x): any {
  // Check to see if we're working with an object/array
  // if so, they gave us the deck and we'll pick the card
  if (typeof x == "object") {
    let pickedCard = Math.floor(Math.random() * x.length)
    return pickedCard
  }
  // Otherwise just let them pick the card
  else if (typeof x == "number") {
    let pickedSuit = Math.floor(x / 13)
    return { suit: suits[pickedSuit], card: x % 13 }
  }
}

posts/generics.html.body:
泛型

英文文档：http://www.typescriptlang.org/docs/handbook/generics.html
中文文档：https://www.tslang.cn/docs/handbook/generics.html

在像 C#和 Java 这样的语言中，可以使用泛型来创建可重用的组件，一个组件可以支持多种类型的数据。
泛型函数
function identity(arg: T): T {
  return arg
}

let output = identity("myString")

泛型接口
interface GenericIdentityFn {
  (arg: T): T
}

function identity(arg: T): T {
  return arg
}

let myIdentity: GenericIdentityFn = identity

泛型类
class GenericNumber {
  zeroValue: T
  add: (x: T, y: T) => T
}

let myGenericNumber = new GenericNumber()
myGenericNumber.zeroValue = 0
myGenericNumber.add = function(x, y) {
  return x + y
}


泛型类指的是实例部分的类型，所以类的静态属性不能使用这个泛型类型。

泛型约束
泛型约束，使得loggingIdentity接受的参数必须实现了.length属性，也就是说它不能再是任意类型了。
interface Lengthwise {
  length: number
}

function loggingIdentity(arg: T): T {
  console.log(arg.length) // Now we know it has a .length property, so no more error
  return arg
}

在泛型约束中使用类型参数
现在我们想要用属性名从对象里获取这个属性。 并且我们想要确保这个属性存在于对象 obj上，因此我们需要在这两个类型之间使用约束。
function getProperty(obj: T, key: K) {
  return obj[key]
}

let x = { a: 1, b: 2, c: 3, d: 4 }

getProperty(x, "a") // okay
getProperty(x, "m") // error: 类型“"m"”的参数不能赋给类型“"a" | "b" | "c" | "d"”的参数。

在泛型里使用类类型
function createInstance(c: new () => A): A {
  return new c()
}
